import React from "react";
import Cover from "../assets/images/Cover.png";



export default function Header() {
  const bgImageHeader = {
    backgroundImage: `url(${Cover})`,
    backgroundSize: "cover",
    backgroundPosition: "center",
    width: "100%",
    height: "100%",
    position: "absolute",
  };

  const overlay = {
    content: "",
    position: "absolute",
    top: "0",
    left: "0",
    width: "100%",
    height: "100%",
    backgroundColor: "rgba(0, 0, 0, .45)" /* Black with 24% opacity */,
    color: "white",
  };

  return (
    <>
      <div className="bg-image" style={bgImageHeader}>
        <div className="overlay text-center " style={overlay}>
       <div className="header-home p-5">
        <h1 className="text-center">301_CATCHING</h1>
        <h4>
          THE FOUNDATIONAL
        </h4>
         </div>
        </div>
        </div>
    </>
   
 
  );
}
